import React from "react";
import { Button } from "@/components/ui/button"

export function ButtonDemo() {
  return <Button>Button</Button>
}

const Header = () => {
  return (
    <div>
      <div>
        <h1 class="text-4xl font-bold p-4">Notes</h1>
      </div>
      <div></div>
    </div>
  );
};

export default Header;
